import React, { useState } from "react";
import { BASE_URL, REGISTER } from "../../Api/APi";
import axios from "axios";
import "./form.css";
import "./button.css";
import { useNavigate } from "react-router-dom";
import Loading from "../../Loading/Loading";
import Cookie from "cookie-universal";

const Register = () => {
  const [name, setName] = useState("");
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [confirmPassword, setConfirmPassword] = useState("");
  const [message, setMessage] = useState("");
  const [loading, setloading] = useState(false);
  // cookie
  const cookie = Cookie();

  const Navigate = useNavigate();

  const handleSubmit = async (e) => {
    e.preventDefault();
    setloading(true);

    if (password !== confirmPassword) {
      setMessage("Passwords do not match");
      setloading(false);
      return;
    }

    try {
      const res = await axios.post(`${BASE_URL}/${REGISTER}`, {
        name,
        email,
        password,
        confirmPassword,
      });
      const token = res.data.data.token;
      cookie.set("Bearer", token);
      setloading(false);
      Navigate("/");
      setMessage("User registered successfully");
    } catch (error) {
      setloading(false);
      if (error.response && error.response.status === 400) {
        setMessage("Email is already been taken");
      } else {
        setMessage("Internal Server Error");
      }
    }
  };

  // هنا التعديل: redirect مباشر لصفحة Google OAuth
  const googleAuth = () => {
    const client_id = "YOUR_GOOGLE_CLIENT_ID"; // حط هنا الـ Client ID الخاص بيك
    const redirect_uri = `${BASE_URL}/google/auth`; // نفس اللي في backend redirect_uri
    const scope =
      "https://www.googleapis.com/auth/userinfo.email https://www.googleapis.com/auth/userinfo.profile";
    const response_type = "code";
    const access_type = "offline"; // لو عايز ريفرش توكن ممكن تحطها، لو مش عايز اشيلها

    const googleAuthUrl = `https://accounts.google.com/o/oauth2/v2/auth?client_id=${client_id}&redirect_uri=${encodeURIComponent(
      redirect_uri
    )}&response_type=${response_type}&scope=${encodeURIComponent(
      scope
    )}&access_type=${access_type}`;

    window.location.href = googleAuthUrl;
  };

  return (
    <>
      {loading && <Loading />}
      <div className="container">
        <div className="row h-100">
          <form onSubmit={handleSubmit} className="form custom-form">
            <div className="custom-form">
              <h1>Register Now</h1>
              <div className="form-control">
                <input
                  type="text"
                  id="name"
                  name="name"
                  value={name}
                  onChange={(e) => setName(e.target.value)}
                  required
                  placeholder="Enter your full name"
                />
                <label htmlFor="name">Full Name</label>
              </div>
              <div className="form-control">
                <input
                  type="email"
                  id="email"
                  name="email"
                  value={email}
                  onChange={(e) => setEmail(e.target.value)}
                  required
                  placeholder="example@mail.com"
                />
                <label htmlFor="email">Email</label>
              </div>
              <div className="form-control">
                <input
                  type="password"
                  id="password"
                  name="password"
                  value={password}
                  onChange={(e) => setPassword(e.target.value)}
                  required
                  placeholder="********"
                  minLength={6}
                />
                <label htmlFor="password">Password</label>
              </div>
              <div className="form-control">
                <input
                  type="password"
                  id="confirmPassword"
                  name="confirmPassword"
                  value={confirmPassword}
                  onChange={(e) => setConfirmPassword(e.target.value)}
                  required
                  minLength={6}
                  placeholder="********"
                />
                <label htmlFor="confirmPassword">Confirm Password</label>
              </div>
              <button type="submit" className="btn btn-primary">
                Register
              </button>
              {message !== "" && <span className="error">{message}</span>}
            </div>
          </form>

          <button onClick={googleAuth} className="btn btn-google">
            Sign in with Google
          </button>
        </div>
      </div>
    </>
  );
};

export default Register;
